            <Stack.Screen name="Login" component={Login} />
          </Stack.Navigator>
         </NavigationContainer>
      );





    }

  }

const HomeScreen = ({ navigation }) => {
  return (
    <Button
      title="Go to Reco's profile"
      onPress={() =>
        navigation.navigate('Profile', { name: 'Reco' })
      }
    />
  );
};

const ProfileScreen = () => {
  return <Text>This is Reco's profile</Text>;
};


const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
